// src/components/Home.js
import React from 'react';
import './Home.css';

function Home() {
    return (
        <div className="home">
            <h1>Kaushik Das</h1>
            <p>Experienced AI Developer with expertise in Machine Learning, Deep Learning, and Generative AI.</p>
        </div>
    );
}

export default Home;
